                {/* <img src={require('./dog.svg')} alt="My Dog" /> */}
                </picture>
                <h3>Name:<span className="card-petName"> {animal.name}</span></h3>
                <p>Breed:{animal.breed}</p>
                <button type="button" onClick={() => handleDeleteAnimal(animal.id)}>Discharge</button>
